import React, { Fragment } from "react";
import styles from "./HeaderCartButton.module.css";
const HeaderCartButton = (props) => {
  return (
    <Fragment>
      <button className={styles.button}>{props.children}</button>
    </Fragment>
  );
};

export default HeaderCartButton;
